    <link rel="stylesheet" href="/static/style.css">
    <link rel="icon" href="/static/icon.png">
    <style>
        :root {
            --primary-color: #0077cc;
            --secondary-color: #f0f4fa;
            --background-color: #f7fafd;
            --red-color: #ff4136;
            --yellow-color: #ffb700;
            --green-color: #2ecc40;
            --gray-color: #e0e0e0;
            --white-color: #ffffff;
        }
        .container {
            width: calc(12px * 72);
        }
        .service-header .status-bar,
        .port-block .status-bar {
            grid-template-columns: repeat(72, 1fr) !important;
        }
        @media (max-width: calc(12px * 72)) {
            .container {
                width: 100%;
                min-width: 0;
                max-width: 100vw;
                padding-left: 2px;
                padding-right: 2px;
                margin: 0;
                border-radius: 0;
                box-shadow: none;
            }
            .logo-img {
                height: auto;
                max-height: 96px;
                max-width: 100%;
            }
            .update-time {
                font-size: 0.92em;
                margin-bottom: 10px;
            }
            .service-block {
                padding: 10px 6px 10px 6px;
                margin-bottom: 18px;
                border-radius: 8px;
            }
            .service-header h2 {
                font-size: 1.5em;
            }
            .service-header .availability-badge {
                font-size: 1.5em;
                padding: 6px 12px;
            }
            .service-header .status-bar,
            .port-block .status-bar {
                padding: 0;
                column-gap: 0;
            }
            .status-bar .status-rect {
                height: 18px;
                margin: 0;
                width: 100%;
                box-shadow: none;
                border-radius: 0;
            }
            .port-block {
                margin-bottom: 12px;
                padding: 6px 4px 4px 4px;
                border-radius: 6px;
                background: var(--secondary-color);
                box-shadow: 0 1px 4px rgba(44, 124, 255, 0.04);
            }
            .port-block .port-url {
                min-width: 80px;
                font-size: 0.92em;
                margin-bottom: 2px;
                color: var(--primary-color);
                font-weight: 500;
            }
        }
    </style>
</head>
